import React, { Fragment, Component } from 'react'
import { Container } from 'reactstrpo'
import './Modal.css'

export class Modal extends Component{
	render(){
		const { children, appear } = this.props
		return(
			<Container className='modal-layer'>
				appear && { children }
			</Container>
		)
	}
}
